// Playlist.js

import React from 'react';
import { FaMusic } from 'react-icons/fa';

function Playlist() {
  // Ganti dengan lagu-lagu favoritmu
  const songs = [
    { title: 'Lagu Favorit 1', url: '/assets/music/lagu1.mp3' },
    { title: 'Lagu Favorit 2', url: '/assets/music/lagu2.mp3' },
  ];
  return (
    <section className="playlist-section">
      <h2 className="playlist-header">Playlist Tahun Baru</h2>
      <div className="playlist-list">
        {songs.map((s, i) => (
          <div className="playlist-card" key={i}>
            <div className="playlist-title">
              <FaMusic className="playlist-icon" />
              <span>{s.title}</span>
            </div>
            <audio controls src={s.url} className="playlist-audio" />
          </div>
        ))}
      </div>
    </section>
  );
}

export default Playlist;
